window.bookSummaryJSON = "<p>He is one of the longest-running cast members on <i>Saturday Night Live</i>, an American comedy genius renowned for his spot-on sendups of politicians and celebrities. But off-stage, Darrell Hammond’s life was anything but a joke. In <i>CRAY,</i> a special audio performance captured live onstage at Audible’s Minetta Lane Theatre, Hammond brings to life his acclaimed memoir, <i>God</i>, <i>If You're Not Up There, I'm F*cked: Tales of Stand-Up, Saturday Night Live and Other Mind-Altering Mayhem</i>. Embodying over 60 different characters, he takes listeners on a heartbreaking and hilarious journey through abuse, addiction, and recovery. The exhilarating story unravels the mystery of how a man repeatedly climbed from the depths of despair to the height of comedy royalty.</p> <p>Available in Dolby Atmos on Audible.</p>"; 
